import React from 'react'

const Signin = () => {
  function validateEmail(value: string){
    let error
      if(!value){
      error = "required"
      
      }else if(!/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,4}$/i.test(value)){
        error = "invalid email address"
      }
      return error
    }
    
    function validateUsername(value: string) {
      let error;
      if (value === 'admin') {
        error = 'admin!'
      }
      return error
    }




    


  return (
    <div>
        <form>
            <input type="email" />
            <input type="text" />
            <button>Login</button>
        </form>
    </div>
  )
}

export default Signin
